import React, { useState, useEffect, useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';
import { AuthContext } from '../context/AuthContext';
import './AdminDashboard.css';

const AdminDashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();
  const [activeTab, setActiveTab] = useState('overview');
  const [bookings, setBookings] = useState([]);
  const [cars, setCars] = useState([]);
  const [loading, setLoading] = useState(true);
  const [showCarForm, setShowCarForm] = useState(false);
  const [editingCar, setEditingCar] = useState(null);

  const handleLogout = () => {
    logout();
    navigate('/');
  };

  const [carFormData, setCarFormData] = useState({
    name: '',
    brand: '',
    model: '',
    year: new Date().getFullYear(),
    pricePerDay: '',
    price30min: '',
    price60min: '',
    currency: 'AED',
    seats: '',
    transmission: 'Automatic',
    fuelType: 'Petrol',
    image: '',
    description: '',
    available: true
  });

  useEffect(() => {
    fetchBookings();
    fetchCars();
  }, []);

  useEffect(() => {
    if (activeTab === 'bookings') {
      fetchBookings();
    } else if (activeTab === 'cars') {
      fetchCars();
    }
  }, [activeTab]);

  const fetchBookings = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/admin/bookings');
      setBookings(response.data);
    } catch (error) {
      console.error('Error fetching bookings:', error);
    } finally {
      setLoading(false);
    }
  };

  const fetchCars = async () => {
    try {
      setLoading(true);
      const response = await axios.get('/api/cars');
      setCars(response.data);
    } catch (error) {
      console.error('Error fetching cars:', error);
    } finally {
      setLoading(false);
    }
  };

  const handleCarFormChange = (e) => {
    const { name, value, type, checked } = e.target;
    setCarFormData({
      ...carFormData,
      [name]: type === 'checkbox' ? checked : value
    });
  };

  const handleCarSubmit = async (e) => {
    e.preventDefault();
    try {
      if (editingCar) {
        await axios.put(`/api/admin/cars/${editingCar._id}`, carFormData);
      } else {
        await axios.post('/api/admin/cars', carFormData);
      }
      setShowCarForm(false);
      setEditingCar(null);
      setCarFormData({
        name: '',
        brand: '',
        model: '',
        year: new Date().getFullYear(),
        pricePerDay: '',
        seats: '',
        transmission: 'Automatic',
        fuelType: 'Petrol',
        image: '',
        description: '',
        available: true
      });
      fetchCars();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to save car');
    }
  };

  const handleEditCar = (car) => {
    setEditingCar(car);
    setCarFormData({
      name: car.name,
      brand: car.brand,
      model: car.model,
      year: car.year,
      pricePerDay: car.pricePerDay,
      price30min: car.price30min || '',
      price60min: car.price60min || '',
      currency: car.currency || 'AED',
      seats: car.seats,
      transmission: car.transmission,
      fuelType: car.fuelType,
      image: car.image,
      description: car.description || '',
      available: car.available
    });
    setShowCarForm(true);
  };

  const handleDeleteCar = async (carId) => {
    if (!window.confirm('Are you sure you want to delete this car?')) {
      return;
    }
    try {
      await axios.delete(`/api/admin/cars/${carId}`);
      fetchCars();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to delete car');
    }
  };

  const handleUpdateBookingStatus = async (bookingId, status) => {
    try {
      await axios.put(`/api/admin/bookings/${bookingId}/status`, { status });
      fetchBookings();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to update status');
    }
  };

  const handleCancelBooking = async (bookingId) => {
    if (!window.confirm('Are you sure you want to cancel this booking?')) {
      return;
    }
    try {
      await axios.put(`/api/bookings/${bookingId}/cancel`);
      fetchBookings();
    } catch (error) {
      alert(error.response?.data?.message || 'Failed to cancel booking');
    }
  };

  // Calculate stats
  const stats = {
    totalCars: cars.length,
    availableCars: cars.filter(car => car.available).length,
    bookedCars: cars.length - cars.filter(car => car.available).length,
    totalBookings: bookings.length,
    pendingBookings: bookings.filter(b => b.status === 'pending').length,
    confirmedBookings: bookings.filter(b => b.status === 'confirmed').length,
    cancelledBookings: bookings.filter(b => b.status === 'cancelled').length,
    completedBookings: bookings.filter(b => b.status === 'completed').length,
    totalRevenue: bookings
      .filter(b => b.status === 'confirmed' || b.status === 'completed')
      .reduce((sum, b) => sum + (b.totalPrice || 0), 0)
  };

  const getStatusBadge = (status) => {
    const statusMap = {
      pending: { class: 'status-pending', text: 'Pending' },
      confirmed: { class: 'status-confirmed', text: 'Confirmed' },
      cancelled: { class: 'status-cancelled', text: 'Cancelled' },
      completed: { class: 'status-completed', text: 'Completed' }
    };
    const statusInfo = statusMap[status] || statusMap.pending;
    return <span className={`status-badge ${statusInfo.class}`}>{statusInfo.text}</span>;
  };

  return (
    <div className="admin-dashboard">
      <div className="container">
        <div className="admin-header">
          <h1>Admin Dashboard</h1>
          <button onClick={handleLogout} className="btn-logout-admin">
            <svg viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
              <path d="M9 21H5C4.46957 21 3.96086 20.7893 3.58579 20.4142C3.21071 20.0391 3 19.5304 3 19V5C3 4.46957 3.21071 3.96086 3.58579 3.58579C3.96086 3.21071 4.46957 3 5 3H9M16 17L21 12M21 12L16 7M21 12H9" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
            Logout
          </button>
        </div>
        <div className="admin-tabs">
          <button
            className={activeTab === 'overview' ? 'active' : ''}
            onClick={() => setActiveTab('overview')}
          >
            Overview
          </button>
          <button
            className={activeTab === 'bookings' ? 'active' : ''}
            onClick={() => setActiveTab('bookings')}
          >
            Bookings
          </button>
          <button
            className={activeTab === 'cars' ? 'active' : ''}
            onClick={() => setActiveTab('cars')}
          >
            Cars
          </button>
        </div>

        {activeTab === 'overview' && (
          <div className="admin-overview">
            <div className="stats-grid">
              <div className="stat-card stat-primary">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M9 17V7M9 7L5 11M9 7L13 11M15 7V17M15 17L19 13M15 17L11 13"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.totalCars}</h3>
                  <p>Total Vehicles</p>
                </div>
              </div>
              <div className="stat-card stat-success">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M9 12L11 14L15 10M21 12C21 16.9706 16.9706 21 12 21C7.02944 21 3 16.9706 3 12C3 7.02944 7.02944 3 12 3C16.9706 3 21 7.02944 21 12Z"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.availableCars}</h3>
                  <p>Available Cars</p>
                </div>
              </div>
              <div className="stat-card stat-warning">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M9 5H7C5.89543 5 5 5.89543 5 7V19C5 20.1046 5.89543 21 7 21H17C18.1046 21 19 20.1046 19 19V7C19 5.89543 18.1046 5 17 5H15M9 5C9 6.10457 9.89543 7 11 7H13C14.1046 7 15 6.10457 15 5M9 5C9 3.89543 9.89543 3 11 3H13C14.1046 3 15 3.89543 15 5"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.bookedCars}</h3>
                  <p>Booked Cars</p>
                </div>
              </div>
              <div className="stat-card stat-info">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M9 5H7C5.89543 5 5 5.89543 5 7V19C5 20.1046 5.89543 21 7 21H17C18.1046 21 19 20.1046 19 19V7C19 5.89543 18.1046 5 17 5H15M9 5C9 6.10457 9.89543 7 11 7H13C14.1046 7 15 6.10457 15 5M9 5C9 3.89543 9.89543 3 11 3H13C14.1046 3 15 3.89543 15 5M12 12H15M12 16H15M9 12H9.01M9 16H9.01"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.totalBookings}</h3>
                  <p>Total Bookings</p>
                </div>
              </div>
              <div className="stat-card stat-pending">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M12 8V12L15 15M22 12C22 17.5228 17.5228 22 12 22C6.47715 22 2 17.5228 2 12C2 6.47715 6.47715 2 12 2C17.5228 2 22 6.47715 22 12Z"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.pendingBookings}</h3>
                  <p>Pending</p>
                </div>
              </div>
              <div className="stat-card stat-revenue">
                <div className="stat-icon">
                  <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" strokeWidth="2">
                    <path d="M12 2V22M17 5H9.5C8.57174 5 7.6815 5.36875 7.02513 6.02513C6.36875 6.6815 6 7.57174 6 8.5C6 9.42826 6.36875 10.3185 7.02513 10.9749C7.6815 11.6312 8.57174 12 9.5 12H14.5C15.4283 12 16.3185 12.3687 16.9749 13.0251C17.6312 13.6815 18 14.5717 18 15.5C18 16.4283 17.6312 17.3185 16.9749 17.9749C16.3185 18.6312 15.4283 19 14.5 19H6"/>
                  </svg>
                </div>
                <div className="stat-content">
                  <h3>{stats.totalRevenue.toLocaleString()} AED</h3>
                  <p>Total Revenue</p>
                </div>
              </div>
            </div>

            <div className="charts-section">
              <div className="chart-card">
                <h3>Booking Status</h3>
                <div className="chart-container">
                  <div className="chart-bar">
                    <div className="bar-label">Pending</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-pending" 
                        style={{ width: `${stats.totalBookings > 0 ? (stats.pendingBookings / stats.totalBookings) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.pendingBookings}</span>
                    </div>
                  </div>
                  <div className="chart-bar">
                    <div className="bar-label">Confirmed</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-confirmed" 
                        style={{ width: `${stats.totalBookings > 0 ? (stats.confirmedBookings / stats.totalBookings) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.confirmedBookings}</span>
                    </div>
                  </div>
                  <div className="chart-bar">
                    <div className="bar-label">Cancelled</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-cancelled" 
                        style={{ width: `${stats.totalBookings > 0 ? (stats.cancelledBookings / stats.totalBookings) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.cancelledBookings}</span>
                    </div>
                  </div>
                  <div className="chart-bar">
                    <div className="bar-label">Completed</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-completed" 
                        style={{ width: `${stats.totalBookings > 0 ? (stats.completedBookings / stats.totalBookings) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.completedBookings}</span>
                    </div>
                  </div>
                </div>
              </div>

              <div className="chart-card">
                <h3>Vehicle Status</h3>
                <div className="chart-container">
                  <div className="chart-bar">
                    <div className="bar-label">Available</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-success" 
                        style={{ width: `${stats.totalCars > 0 ? (stats.availableCars / stats.totalCars) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.availableCars}</span>
                    </div>
                  </div>
                  <div className="chart-bar">
                    <div className="bar-label">Booked</div>
                    <div className="bar-wrapper">
                      <div 
                        className="bar-fill bar-warning" 
                        style={{ width: `${stats.totalCars > 0 ? (stats.bookedCars / stats.totalCars) * 100 : 0}%` }}
                      ></div>
                      <span className="bar-value">{stats.bookedCars}</span>
                    </div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        )}

        {activeTab === 'bookings' && (
          <div className="admin-section">
            {loading ? (
              <div className="loading">Loading bookings...</div>
            ) : (
              <div className="bookings-table">
                {bookings.length === 0 ? (
                  <p>No bookings found.</p>
                ) : (
                  bookings.map((booking) => {
                    if (!booking.car || !booking.user) {
                      return null;
                    }
                    return (
                      <div key={booking._id} className="booking-row">
                        <div className="booking-info">
                          <h4>{booking.car?.name || 'Unknown Car'}</h4>
                          <p>Customer: {booking.user?.name || 'Unknown'} ({booking.user?.email || 'N/A'})</p>
                          <p>
                            {new Date(booking.startDate).toLocaleDateString()} -{' '}
                            {new Date(booking.endDate).toLocaleDateString()}
                          </p>
                          <p>Total: {booking.totalPrice} {booking.car?.currency || 'AED'}</p>
                        </div>
                        <div className="booking-actions">
                          {getStatusBadge(booking.status)}
                          <select
                            value={booking.status}
                            onChange={(e) => handleUpdateBookingStatus(booking._id, e.target.value)}
                            className="status-select"
                          >
                            <option value="pending">Pending</option>
                            <option value="confirmed">Confirmed</option>
                            <option value="cancelled">Cancelled</option>
                            <option value="completed">Completed</option>
                          </select>
                        </div>
                      </div>
                    );
                  })
                )}
              </div>
            )}
          </div>
        )}

        {activeTab === 'cars' && (
          <div className="admin-section">
            <button
              onClick={() => {
                setShowCarForm(true);
                setEditingCar(null);
                setCarFormData({
                  name: '',
                  brand: '',
                  model: '',
                  year: new Date().getFullYear(),
                  pricePerDay: '',
                  price30min: '',
                  price60min: '',
                  currency: 'AED',
                  seats: '',
                  transmission: 'Automatic',
                  fuelType: 'Petrol',
                  image: '',
                  description: '',
                  available: true
                });
              }}
              className="btn btn-primary"
            >
              Add New Car
            </button>

            {showCarForm && (
              <div className="car-form-modal">
                <div className="car-form-content">
                  <h3>{editingCar ? 'Edit Car' : 'Add New Car'}</h3>
                  <form onSubmit={handleCarSubmit}>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Name *</label>
                        <input
                          type="text"
                          name="name"
                          value={carFormData.name}
                          onChange={handleCarFormChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Brand *</label>
                        <input
                          type="text"
                          name="brand"
                          value={carFormData.brand}
                          onChange={handleCarFormChange}
                          required
                        />
                      </div>
                    </div>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Model *</label>
                        <input
                          type="text"
                          name="model"
                          value={carFormData.model}
                          onChange={handleCarFormChange}
                          required
                        />
                      </div>
                      <div className="form-group">
                        <label>Year *</label>
                        <input
                          type="number"
                          name="year"
                          value={carFormData.year}
                          onChange={handleCarFormChange}
                          required
                        />
                      </div>
                    </div>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Price per Day ({carFormData.currency || 'AED'}) *</label>
                        <input
                          type="number"
                          name="pricePerDay"
                          value={carFormData.pricePerDay}
                          onChange={handleCarFormChange}
                          required
                          min="0"
                        />
                      </div>
                      <div className="form-group">
                        <label>Price 60min ({carFormData.currency || 'AED'})</label>
                        <input
                          type="number"
                          name="price60min"
                          value={carFormData.price60min}
                          onChange={handleCarFormChange}
                          min="0"
                        />
                      </div>
                    </div>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Price 30min ({carFormData.currency || 'AED'})</label>
                        <input
                          type="number"
                          name="price30min"
                          value={carFormData.price30min}
                          onChange={handleCarFormChange}
                          min="0"
                        />
                      </div>
                      <div className="form-group">
                        <label>Currency</label>
                        <select
                          name="currency"
                          value={carFormData.currency}
                          onChange={handleCarFormChange}
                        >
                          <option value="AED">AED</option>
                          <option value="USD">USD</option>
                          <option value="EUR">EUR</option>
                        </select>
                      </div>
                    </div>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Seats *</label>
                        <input
                          type="number"
                          name="seats"
                          value={carFormData.seats}
                          onChange={handleCarFormChange}
                          required
                          min="1"
                        />
                      </div>
                    </div>
                    <div className="form-row">
                      <div className="form-group">
                        <label>Transmission *</label>
                        <select
                          name="transmission"
                          value={carFormData.transmission}
                          onChange={handleCarFormChange}
                          required
                        >
                          <option value="Manual">Manual</option>
                          <option value="Automatic">Automatic</option>
                        </select>
                      </div>
                      <div className="form-group">
                        <label>Fuel Type *</label>
                        <select
                          name="fuelType"
                          value={carFormData.fuelType}
                          onChange={handleCarFormChange}
                          required
                        >
                          <option value="Petrol">Petrol</option>
                          <option value="Diesel">Diesel</option>
                          <option value="Electric">Electric</option>
                          <option value="Hybrid">Hybrid</option>
                        </select>
                      </div>
                    </div>
                    <div className="form-group">
                      <label>Image URL</label>
                      <input
                        type="url"
                        name="image"
                        value={carFormData.image}
                        onChange={handleCarFormChange}
                        placeholder="https://example.com/image.jpg"
                      />
                    </div>
                    <div className="form-group">
                      <label>Description</label>
                      <textarea
                        name="description"
                        value={carFormData.description}
                        onChange={handleCarFormChange}
                        rows="3"
                      />
                    </div>
                    <div className="form-group">
                      <label>
                        <input
                          type="checkbox"
                          name="available"
                          checked={carFormData.available}
                          onChange={handleCarFormChange}
                        />
                        Available
                      </label>
                    </div>
                    <div className="form-actions">
                      <button type="submit" className="btn btn-primary">
                        {editingCar ? 'Update Car' : 'Add Car'}
                      </button>
                      <button
                        type="button"
                        onClick={() => {
                          setShowCarForm(false);
                          setEditingCar(null);
                        }}
                        className="btn btn-secondary"
                      >
                        Cancel
                      </button>
                    </div>
                  </form>
                </div>
              </div>
            )}

            {loading ? (
              <div className="loading">Loading cars...</div>
            ) : (
              <div className="cars-grid">
                {cars.map((car) => (
                  <div key={car._id} className="car-admin-card">
                    <img src={car.image} alt={car.name} />
                    <div className="car-admin-info">
                      <h4>{car.name}</h4>
                      <p>{car.brand} {car.model} ({car.year})</p>
                      <p>{car.price60min ? `${car.price60min} ${car.currency || 'AED'}/60min` : `${car.pricePerDay} ${car.currency || 'AED'}/day`}</p>
                      <div className="car-admin-actions">
                        <button
                          onClick={() => handleEditCar(car)}
                          className="btn btn-secondary"
                        >
                          Edit
                        </button>
                        <button
                          onClick={() => handleDeleteCar(car._id)}
                          className="btn btn-danger"
                        >
                          Delete
                        </button>
                      </div>
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

export default AdminDashboard;
